<script>
import anime from 'animejs';
export default {
  name: "Session1Page35",
  methods: {
    animateSvg() {
      let vw = document.querySelector('.interactive-container').clientWidth;
      let smallClouds = document.getElementsByClassName('shp-cloud-small')
      smallClouds.forEach(smallCloud => {
        let plusOrMinus = Math.random() < 0.5 ? -1 : 1;
        anime({
          targets: smallCloud,
          translateX: (Math.floor(Math.random() * 0.5 * vw) + 0.2 * vw) * plusOrMinus,
          duration: (Math.floor(Math.random() * 1000) + 8000),
          loop: true,
          direction: 'alternate',
          easing: 'linear'
        })
      })

      let bigClouds = document.getElementsByClassName('big-clouds')
      bigClouds.forEach(bigCloud => {
        let plusOrMinus = Math.random() < 0.5 ? -1 : 1;
        anime({
          targets: bigCloud,
          translateX: (Math.floor(Math.random() * 0.2 * vw) + 0.2 * vw) * plusOrMinus,
          duration: (Math.floor(Math.random() * 5000) + 18000),
          loop: true,
          direction: 'alternate',
          easing: 'linear'
        })
      })

      anime({
        targets: '.surfing-duck',
        skewY: '1deg',
        easing: 'linear',
        duration: 1000,
        direction: 'alternate',
        loop: true
      })
      anime({
        targets: '.crab-eye',
        translateX: -0.02 * vw,
        duration: 1000,
        direction: 'alternate',
        easing: 'linear',
        loop: true,
        delay: 1000
      })
    },
    animateText() {
      let text = document.querySelector('.para-box').children;
      let animation = anime.timeline({
        easing: 'linear',
        duration: 500,
      })
      animation
        .add({
          targets: '.text-box',
          opacity: 0.95,
        }, 657)
        .add({
          targets: '.para-box',
          opacity: 0.95,
        }, 5501)
        .add({
          targets: text[1],
          opacity: 1,
        }, 9267)
        .add({
          targets: text[2],
          opacity: 1,
        }, 10841)
        .add({
          targets: text[3],
          opacity: 1,
        }, 33067)
        .add({
          targets: text[4],
          opacity: 1,
        }, 35640)
        .add({
          targets: text[5],
          opacity: 1,
        }, 50476)
        .add({
          targets: text[6],
          opacity: 1,
        }, 54059)
        .add({
          targets: text[7],
          opacity: 1,
        }, 65779)
        .add({
          targets: text[8],
          opacity: 1,
        }, 72252)
        .add({
          targets: text[9],
          opacity: 1,
        }, 86016)
        .add({
          targets: text[10],
          opacity: 1,
        }, 94171)
    },
    setAudioVolumeLevel(level) {
      this.$refs.audio.volume = level;
    },
    playVoiceOver() {
      setTimeout(() => {this.$refs.voice.play()}, 500)
    },
  },
  mounted() {
    this.animateSvg();
    this.animateText();
    this.setAudioVolumeLevel(0.5);
    this.playVoiceOver();
  }
}
</script>

